Hmm, it seems the AFL fuzzer is also not available in the default repositories. Let me try a different approach and use a simple script to fuzz the binary:

```python
import subprocess
import string

def fuzz_bard():
    for char in string.printable:
        try:
            proc = subprocess.Popen(['~/ctf_files/bard'], stdin=subprocess.PIPE, stdout=subprocess.PIPE, stderr=subprocess.PIPE)
            out, err = proc.communicate(char.encode())
            if b'Invalid alignment' not in out:
                print(f'Interesting input: {char}')
        except Exception as e:
            pass

fuzz_bard()
```

